import 'week_detail_response.dart';

class CommitResponse {
  int? code;
  String? msg;
  CommitRequest? data;

  CommitResponse(this.code, this.msg,this.data);

  @override
  String toString() {
    StringBuffer sb = new StringBuffer('{');
    sb.write(",\"code\":$code");
    sb.write(",\"msg\":\"$msg\"");
    sb.write(",\"data\":");
    sb.write("\"${data!.toJson()}\"");
    sb.write('}');
    return sb.toString();
  }

  CommitResponse.fromJson(dynamic json) {
    code = json['code'];
    msg = json['msg'];
    data = CommitRequest.fromJson(json['data']);
  }
}

class CommitRequest {
  CommitRequest({
      String? muchTime, 
      String? name, 
      String? directory,
      List<Data>? exercises,}){
    _muchTime = muchTime;
    _name = name;
    _directory = directory;
    _exercises = exercises;
}

  CommitRequest.fromJson(dynamic json) {
    _muchTime = json['much_time'];
    _name = json['name'];
    _directory = json['directory'];
    if (json['exercises'] != null) {
      _exercises = [];
      json['exercises'].forEach((v) {
        _exercises?.add(Data.fromJson(v));
      });
    }
  }
  String? _muchTime;
  String? _name;
  String? _directory;
  List<Data>? _exercises;
CommitRequest copyWith({  String? muchTime,
  String? name,
  String? directory,
  List<Data>? exercises,
}) => CommitRequest(  muchTime: muchTime ?? _muchTime,
  name: name ?? _name,
  directory: directory ?? _directory,
  exercises: exercises ?? _exercises,
);
  String? get muchTime => _muchTime;
  String? get name => _name;
  String? get directory => _directory;
  List<Data>? get exercises => _exercises;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['much_time'] = _muchTime;
    map['name'] = _name;
    map['directory'] = _directory;
    if (_exercises != null) {
      map['exercises'] = _exercises?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}